import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <section>
      <div>
        <div>
          <h1>Professional Development</h1>
          <p>Learn more, earn more!</p>
          <div>
            <a href='register.html'>Register</a>
          </div>
          <div>
            <a href='login.html'>Login</a>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Home;
